export const FilterReducer =(filterState, action)=>{
    switch (action.type) {

        case 'CTRY_FOR_MEN':
            return {...filterState,catogaryForMen:action.payload}
        case 'CTRY_FOR_WOMEN':
            return {...filterState,catogaryForWomen:action.payload}    
        case 'IN_STOCK':
            return {...filterState,inStoke:action.payload}
        case 'THREE_&_ABOVE':
            return {...filterState,raiting:'THREE_&_ABOVE'}
        case 'FOUR_AND_ABOVE':
            log
            return {...filterState,raining:'FOUR_AND_ABOVE'}

        default:
            break;
    }
}
